队伍得奖情况和组织参赛队伍数量综合评定。\\n\\n \\n\\n3.优秀指导教师奖\\n\\n根据指导队伍得奖情况和组织参赛队伍数量综合评定。\\n\\n \\n\\n4. 优秀志愿者\\n\\n为竞赛的宣传，组织，分发获奖证书做出贡献。\\n\\n \\n\\n六、竞赛报名\\n报名费用：每支队伍需缴纳150元参赛费，通过大赛官网（https://www.saikr.com/dsa/2021）缴纳；用于大赛组织、命题、评审、赛题讲解、证书制作等工作。\\n 报名地址：https://www.saikr.com/dsa/2021 ，参赛者以队为单位在大赛官网自行注册报名。\\n \\n\\n七、联系方式\\n1.qq：2521564294\\n\\n2.qq群：834276274');
